import React, { useEffect, useState } from "react";
import { useParams, useRouteMatch } from "react-router-dom";
import { listCards } from "../utils/api"

function Deck() {
  const { deckId } = useParams();
  const { url } = useRouteMatch();

  const [cards, setCards] = useState([]);

  useEffect(() => {
    async function getCards() {
      try {
        const response = await listCards(deckId);
        setCards(response);
      } catch (error) {
          console.log(error);
      }
    }
    getCards();

  }, [deckId])

  return (
    <>
        <nav aria-label="breadcrumb">
        <ol className="breadcrumb">
            <li className="breadcrumb-item"><a href="/"><span className="oi oi-home"></span> Home</a></li>
            <li className="breadcrumb-item"><a href={`/decks/${deckId}`}>Name</a></li>
            <li className="breadcrumb-item text-secondary">Study</li>
        </ol>
        </nav>
        <div className="card mb-2">
            <div className="card-body">
                <div className="d-flex justify-content-between">
                    <h2>Study: </h2>
                </div>
                <p></p>
                <a href={`${url}/study`} className="btn btn-primary mr-1"><span className="oi oi-book"></span> Study</a>
                <a href={`${url}/edit`} className="btn btn-secondary mr-1"><span className="oi oi-cog"></span> Edit</a>
                <a href={`${url}/cards/new`} className="btn btn-secondary"><span className="oi oi-plus"></span> Add Cards</a>
                <a href={`/`} className="btn btn-danger float-right"><span className="oi oi-trash"></span></a>
            </div>
        </div>
    </>
  );
}

export default Deck;
